arStrings.szText:
{c_label}Saniye başına Saldırı: {c_number}{s1}{/c}{/c}
{icon:bullet} Silah hızına bağlıdır.
{icon:bullet} Yetenekler ve öğeler ile artırılabilir.

{c_label}Kritik Vuruş İhtimali: {c_number}{s1}{/c}{/c}
{icon:bullet} Kritik vuruşlar, {c_number}{s2}{/c} bonus hasar verir.
{icon:bullet} Yetenekler ve öğeler ile artırılabilir.

{c_label}Kalkan Engelleme Değeri: {c_number}{s1}{/c}{/c}
{icon:bullet} Saldırı engellendiğinde önlenen hasar miktarı.
{icon:bullet} Kalkan engelleme değeri, yetenekler ve öğeler ile artırılabilir.

{c_label}Maksimum Can: {c_number}{s2}{/c}{/c}
{icon:bullet} Tüm Canın tükendiğinde ölürsün. 
{icon:bullet} Can, yetenekler ve öğeler ile artırılabilir.

{c_label}Öldürme başına Can: {c_number}{s1}{/c}{/c}
{icon:bullet} Öldürdüğün düşman başına {c_number}{s2}{/c} Can yenilersin.
{icon:bullet} Öldürme başına Can, yetenekler ve öğeler ile artırılabilir.

{c_label}Vuruş başına Can: {c_number}{s1}{/c}{/c}
{icon:bullet} Vurduğun düşman başına {c_number}{s2}{/c} Can yenilersin.
{icon:bullet} Vuruş başına Can, yeteneklerle ve öğelerle artırılabilir.

{c_label}Kritik Vuruş Hasar Bonusu: {/c}{c_number}{s1}{/c}
{icon:bullet} Yetenekler ve öğeler ile artırılabilir.
{icon:bullet} Diğer oyunculara karşı en fazla {c_number}{s2}{/c} olabilir.

{c_label}Hareket Hızı:{/c} {c_number}{s1}{/c}
{icon:bullet} Temel hareket hızının {c_number}{s2}{/c} kadarıyla koşarsın.
{icon:bullet} Öğeler ile en fazla {c_number}+%25,00{/c} hareket hızı elde edebilirsin.

{c_label}Bonus Tecrübe: {c_number}{s1}{/c}{/c}
{icon:bullet} Canavar öldürerek kazanılan tecrübe {c_number}{s2}{/c} artar.
{icon:bullet} Çarpan: {c_number}{s3}x{/c}. Bu çarpan, çok oyunculu oyunlarda verilir.

{c_label}Dikenler:{/c} {c_number}{s1}{/c}
{icon:bullet} Doğrudan saldırılardan isabet alındığında saldırgana hasar verir. Zamanla hasar etkileriyle tetiklenmez.
{icon:bullet} Verilen hasar, ana niteliğinin bir kısmı kadar artar.

{c_label}Maksimum Can: {c_number}{s2}{/c}{/c}
{icon:bullet} Takipçiler, Canlarını tamamen kaybettiklerinde kısa bir süreliğine etkisiz hâle gelir. 
{icon:bullet} Can, yetenekler ve öğelerle artırılabilir.

{c_label}Maksimum Can: {c_number}{s2}{/c}{/c}
{icon:bullet} Takipçiler, Canlarını tamamen kaybettiklerinde kısa bir süreliğine etkisiz hâle gelir. 
{icon:bullet} Can, yetenekler ve öğelerle artırılabilir.

{c_label}Maksimum Can: {c_number}{s2}{/c}{/c}
{icon:bullet} Takipçiler, Canlarını tamamen kaybettiklerinde kısa bir süreliğine etkisiz hâle gelir. 
{icon:bullet} Can, yetenekler ve öğelerle artırılabilir.

{c_label}Alan Hasarı:{/c} {c_number}{s1}{/c}
{icon:bullet} Saldırılar ayrıca {c_number}{s2}{/c} ihtimalle {c_number}{s4}{/c} yarda içindeki düşmanlara {c_number}{s3}{/c} hasar verir.
{icon:bullet} Verilen hasar, öğeler ile artırılabilir.

{c_label}{s1} Hasar Artışı:{/c} {c_number}{s2}{/c}
{icon:bullet} Bu elementi kullanan yeteneklerin verdiği Hasarı artırır.
{icon:bullet} {s3} Hasar: {c_number}{s4}{/c}.

{c_label}İrade:{/c} {c_number}{s1}{/c} {c_lightgray}(Öğe Katkısı: {c_blue}{s4}{/c}){/c}{s2}
{icon:bullet} Alınan İyileşmeyi {c_number}{s3}{/c} artırır
{icon:bullet} {c_important}{u}Aşırı Güç{/u}{/c_important} Hasarını {c_number}{s5}{/c} artırır

{c_label}Öldürme başına Hasar Bariyeri: {c_number}{s1}{/c}{/c}
{icon:bullet} Bir düşmanı öldürdüğünde bir Hasar Bariyeri kazan.
{icon:bullet} Soğurulan hasar miktarı öğelerle artırılabilir.

{c_label}Azaltılmış İksir Bekleme Süresi: {c_number}{s1}{/c}{/c}
{icon:bullet} İksirlerinin bekleme süresini azaltır.
{icon:bullet} Öğeler ile daha da azaltılabilir.

{c_label}Aşırı Güç İhtimali:{/c} {c_number}{s1}{/c}
{icon:bullet} Aşırı Güç, mevcut ve güçlendirilmiş canlarının toplamına göre bonus hasar verir.
{icon:bullet} Zamanla hasar, pasif yetenekler ve yönlendirilen yetenekler aşırı güçlenemez.
